#include <Arduino.h>
#include <WiFi.h>
#include <ESPAsyncWebServer.h>

const char* hostname = "ESP-32";

const char* ssid = "Your_ssid"; // Replace with your custom ssid
const char* password = "your_password";  // Replace with your password

const int led = 2;  // Replace with your LED GPIO pin

IPAddress ip(192, 168, 0, 1);
IPAddress mask(255, 255, 255, 0);

AsyncWebServer s(80);

const char* content = R"rawliteral(
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="icon" href="data:,">
    <title>LED</title>
    <style>
        body {
          background-color: white;
        }

        ::backdrop {
          background-color: white;
        }
        .container {
            margin-top: 40%;
        }
        #out {
            text-align: center;
            margin: 20px auto;
        }
        .led-box {
          height: 50px;
          width: 50px;
          margin: auto;
        }

        #led {
          width: 50px;
          height: 50px;
          margin: 0 auto;
        }

        #led-glow {
          display: none;
          position: absolute;
          margin: 10px 24px;
          width: 2px;
          height: 2px;
          background-color: #ff4444;
          border-radius: 50%;
          box-shadow: 0px 0px 50px 20px #ff0000;
        }
        .switch {
            position: relative;
            display: block;
            width: 60px;
            height: 34px;
            margin: 20% auto;
            -webkit-tap-highlight-color: transparent;
        }
        .switch input {
            opacity: 0;
            width: 0;
            height: 0;
        }
        .slider {
            position: absolute;
            cursor: pointer;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            border-radius: 34px;
            background-color: #ccc;
            -webkit-transition: .4s;
            transition: .4s;
        }
        .slider:before {
            position: absolute;
            content: "";
            height: 26px;
            width: 26px;
            left: 4px;
            bottom: 4px;
            border-radius: 50%;
            background-color: white;
            -webkit-transition: .4s;
            transition: .4s;
        }
        input:checked+.slider {
            background-color: #2196F3;
        }

        input:focus+.slider {
            box-shadow: 0 0 1px #2196F3;
        }
        input:checked+.slider:before {
            -webkit-transform: translateX(26px);
            -ms-transform: translateX(26px);
            transform: translateX(26px);
        }
    </style>
</head>

<body>
    <div class="container">
        <div class="led-box">
            <div id="led-glow"></div>
            <img id="led" onclick="rf()" src="data:image/png;base64,">
        </div>
        <div id="out">OFF</div>

        <label class="switch">
            <input type="checkbox" class="inp">
            <span class="slider"></span>
        </label>
    </div>

    <script>
        function rf() {
            document.querySelector("body").requestFullscreen();
        }
        var a = document.querySelector('.inp');
        function sendata(d) {
            fetch("/data", {
                method: "POST",
                headers: {
                    'Accept': 'text/plain',
                    'Content-Type': 'text/plain'
                },
                body: d
            }).then(res => {
                return res.text();
            }).then(b => {
                document.getElementById("out").innerText = b;
                if (b == "ON") {
                    document.getElementById("led-glow").style.display = "block";
                    if (d == "data=2"){
                      a.checked = true;
                    }
                } else if (b == "OFF") {
                    document.getElementById("led-glow").style.display = "none";
                }
            }).catch(e => {
                document.getElementById("out").innerText = e;
            });
        }
        a.addEventListener("change", function () {
            if (this.checked) {
                sendata("data=1");
            } else {
                sendata("data=0");
            }
        });
        sendata("data=2");
    </script>
</body>
</html>
)rawliteral";


String data;
String sd = "0";

void setup() {
  pinMode(led, OUTPUT);
  WiFi.mode(WIFI_AP);
  WiFi.softAP(ssid, password);
  WiFi.softAPConfig(ip, ip, mask);

  s.on("/", HTTP_GET, [](AsyncWebServerRequest *req){
    req->send_P(200, "text/html", content);
  });

  s.on("/data", HTTP_POST, [](AsyncWebServerRequest *req){
    if (req->hasParam("data", true)){
      data = req->getParam("data", true)->value();
      if (data == "1"){
        digitalWrite(led, HIGH);
        sd = data;
        req->send_P(200, "text/plain", "ON");
      } else if (data == "0"){
        sd = data;
        digitalWrite(led, LOW);
        req->send_P(200, "text/plain", "OFF");
      } else if (data == "2"){
        if (sd == "1") {
          req->send_P(200, "text/plain", "ON");
        } else if (sd == "0") {
          req->send_P(200, "text/plain", "OFF");
        }
      } else {
        req->send_P(200, "text/plain", "Wrong input!");
      }
    } else {
      req->send_P(400, "text/plain", "ERROR");
    }
  });

  s.begin();
  
}

void loop() {
  
}